import React, { Component } from 'react';

class PartnerRegister extends Component {

  state = {
      email: '',
      fullname: '', 
      password: '',
      dob: '',
      gender: '',
      num: '',
      levelOfEducation: '',
      citizenship: '',
      address: '',
      country: '',
      postalcode:''
  }

  render(){
    const {email, fullname, password, dob, gender, num, levelOfEducation, citizenship, address, country, postalcode} = this.state;
    const inputValues = {  email, fullname, password, dob, gender, num, levelOfEducation, citizenship, address, country, postalcode };

  }
}

export default PartnerRegister;
